import React from "react";
import { Nav, NavLink, NavMenu, Header } from "./NavbarElements";

const Navbar = () => {
  return (
    <Nav>
      <Header>Recepty</Header>
      <NavMenu>
        <NavLink to="/Add">Dodaj</NavLink>
        <NavLink to="/CheckStatus">Sprawdź status</NavLink>
        <NavLink to="/Delete">Usuń</NavLink>
        <NavLink to="/Search">Szukaj</NavLink>
      </NavMenu>
    </Nav>
  );
};

export default Navbar;
